INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 1, 125801, 2, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 321, "リリ", 24001, 0, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 1, 126001, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 322, "クリア", 24001, 0, 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 1, 126101, 2, "んーと。\nこれ、あげる。\nはい", 40011, 323, "プレシア", 24001, 0, 3);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (2, 1, 125801, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 324, "リリ", 24001, 0, 4);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (2, 1, 126001, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 325, "クリア", 24001, 0, 5);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (2, 1, 126101, 2, "お兄。\nきてくれて、うれしい", 40011, 326, "プレシア", 24001, 0, 6);
